import { Component } from 'react';
import './App.css';

// COMPONENT
class App extends Component{
  constructor(){
    super();
    this.state={
      monsters: [
      {name:'Ruben'},
      {name:'BRAU'},
      {name: 'mora'}
      ]
  }
}
  render (){
    return(
      //-----------------------------------
        <div className="App">
          {
            this.state.monsters.map((monster)=>{
              return <h1>{monster.name}</h1>
            })
          }
        </div>        
      //-----------------------------------
    );
  }
}

export default App
